import React, { useState } from 'react';
import { aiModels } from '../data/aiModels';
import ModelCard from './ModelCard';
import ComparisonChart from './ComparisonChart';
import ResultsComparison from './ResultsComparison';

const AdvisorPage = () => {
  const [prompt, setPrompt] = useState('');
  const [selectedModels, setSelectedModels] = useState([]);
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [isSearched, setIsSearched] = useState(false);

  const handlePromptChange = (e) => {
    setPrompt(e.target.value);
  };

  const handleModelToggle = (modelId) => {
    setSelectedModels(prev => {
      if (prev.includes(modelId)) {
        return prev.filter(id => id !== modelId);
      } else {
        return [...prev, modelId];
      }
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (prompt.trim() === '') {
      alert('Please enter what you want to use AI for');
      return;
    }

    if (selectedModels.length === 0) {
      alert('Please select at least one AI model to test');
      return;
    }

    setLoading(true);

    try {
      // This would be replaced with actual API calls to Moestro API
      const testResults = await simulateApiCall(prompt, selectedModels);
      setResults(testResults);
      setIsSearched(true);
    } catch (error) {
      console.error('Error testing models:', error);
      alert('An error occurred while testing the models. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  // Simulated API call - would be replaced with actual Moestro API integration
  const simulateApiCall = async (userPrompt, modelIds) => {
    // Simulate API latency
    await new Promise(resolve => setTimeout(resolve, 2000));

    return modelIds.map(id => {
      const model = aiModels.find(m => m.id === id);
      const executionTime = Math.random() * (model.speed * 2) + 1; // Simulated execution time
      const tokenCost = Math.random() * (model.cost * 0.01) + 0.01; // Simulated cost

      return {
        model,
        prompt: `Based on the user request: "${userPrompt}", generate a solution using ${model.name}`,
        output: `This is a simulated output from ${model.name} for the prompt: "${userPrompt}". 
                 In a real implementation, this would be the actual response from the model through the Moestro API.
                 The response would be formatted according to the model's capabilities and the prompt requirements.`,
        metrics: {
          executionTime: executionTime.toFixed(2), // seconds
          tokenCount: Math.floor(Math.random() * 500) + 100,
          costEstimate: tokenCost.toFixed(4), // dollars
          quality: Math.min(5, Math.floor(Math.random() * model.accuracy) + 1)
        }
      };
    });
  };

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="text-center mb-12">
        <h1 className="text-4xl font-extrabold text-gray-900 sm:text-5xl sm:tracking-tight lg:text-6xl">
          Compare AI Model Outputs
        </h1>
        <p className="mt-5 max-w-xl mx-auto text-xl text-gray-500">
          Test multiple AI models with your specific use case and compare their performance.
        </p>
      </div>

      <div className="bg-white shadow-xl rounded-lg overflow-hidden mb-12">
        <div className="px-4 py-5 sm:p-6">
          <form onSubmit={handleSubmit}>
            <div className="space-y-6">
              <div>
                <label htmlFor="prompt" className="block text-sm font-medium text-gray-700">
                  What would you like to use AI for? (Describe your needs)
                </label>
                <div className="mt-1">
                  <textarea
                    id="prompt"
                    name="prompt"
                    rows={4}
                    className="shadow-sm focus:ring-primary-500 focus:border-primary-500 block w-full sm:text-sm border-gray-300 rounded-md"
                    placeholder="e.g., I want to build a customer service chatbot that can handle basic inquiries and route complex questions to human agents."
                    value={prompt}
                    onChange={handlePromptChange}
                  />
                </div>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-3">
                  Select models to test
                </label>
                <div className="grid grid-cols-1 gap-4 sm:grid-cols-2 lg:grid-cols-3">
                  {aiModels.map(model => (
                    <div key={model.id} className="relative flex items-start">
                      <div className="flex items-center h-5">
                        <input
                          id={`model-${model.id}`}
                          name={`model-${model.id}`}
                          type="checkbox"
                          checked={selectedModels.includes(model.id)}
                          onChange={() => handleModelToggle(model.id)}
                          className="focus:ring-primary-500 h-4 w-4 text-primary-600 border-gray-300 rounded"
                        />
                      </div>
                      <div className="ml-3 text-sm">
                        <label htmlFor={`model-${model.id}`} className="font-medium text-gray-700">{model.name}</label>
                        <p className="text-gray-500">{model.provider} â€¢ {model.type}</p>
                      </div>
                    </div>
                  ))}
                </div>
              </div>

              <div>
                <button
                  type="submit"
                  disabled={loading}
                  className={`w-full flex justify-center py-3 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white 
                    ${loading ? 'bg-gray-400' : 'bg-gradient-to-r from-primary-600 to-secondary-600 hover:from-primary-700 hover:to-secondary-700'} 
                    focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500`}
                >
                  {loading ? (
                    <>
                      <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                        <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                        <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                      </svg>
                      Testing Models...
                    </>
                  ) : (
                    'Test Selected Models'
                  )}
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>

      {isSearched && !loading && (
        <div className="space-y-12">
          <div className="bg-white shadow-xl rounded-lg overflow-hidden">
            <div className="px-4 py-5 sm:p-6">
              <h2 className="text-2xl font-bold text-gray-900 mb-4">Test Results</h2>

              {results.length > 0 ? (
                <>
                  <p className="text-gray-500 mb-6">
                    Here are the results from testing {results.length} AI models with your prompt.
                  </p>

                  {/* Performance Metrics Comparison */}
                  {results.length >= 2 && <ComparisonChart models={results.map(r => ({
                    ...r.model,
                    accuracy: r.metrics.quality,
                    executionTime: parseFloat(r.metrics.executionTime),
                    costEstimate: parseFloat(r.metrics.costEstimate) * 1000 // Convert to millicents for display
                  }))} />}

                  {/* Detailed Output Comparison */}
                  <ResultsComparison results={results} prompt={prompt} />
                </>
              ) : (
                <div className="text-center py-12">
                  <p className="text-gray-500">
                    No results available. Please try testing with different models.
                  </p>
                </div>
              )}
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdvisorPage;
